window.bookSummaryJSON = "<p><b>Anthony has been reborn!</b> </p> <p>Placed into the remarkable game-like world of Pangera.</p> <p>But something seems a little off... What's with these skills? <i>Bite</i>? <i>Dig</i>?</p> <p>Wait....</p> <p>He's been reborn as a <i>what</i>?</p> <p>Follow Anthony as he attempts to adjust to his new life as an ant in his new Dungeon home. He'll have to learn how to survive, level-up, and grow both himself and his bite-sized colony into a force to be reckoned with.</p> <p><b>Don't miss the start of a hit LitRPG monster-evolution series with nearly 30 Million views on Royal Road. For the first time, this completed revised, new-and-improved version of </b><b><i>Chrysalis </i></b><b>is now available on Audible, narrated by Jeff Hays (</b><b><i>Dungeon Crawler Carl, New Era Online</i></b><b>).</b></p> <p><b><i>Grab your copy today!</i></b></p> <p><b><i>About this Series: </i></b>Jump into a rebirth story that mixes LitRPG and GameLit Elements with Monster Evolution. Levels, Stats, Skills, Magic, Power Progression, Kingdom Building, Party Building, Army Building, evolution, a monster MC, gigantic enemies (compared to Ant at least), and plenty of humor fitting for such a ludicrous premise. </p>"; 
